      .then((res) => {
        console.log(res.data)
        setData(res.data)
      })
  }, [])

  return (
    data == null ? (
      <div className="App">
        no data 
      </div>
    ) : (
      <div className="App">
        {
          data[0].Phong
        }
      </div>
    )
  );
}

export default App;
